import React, { ReactNode } from 'react';

import DefaultOverlayContent from '../../components/DefaultOverlayContent';
import {ModelsWrapper, ModelsSection} from '../../components/model';

import './styles';
import { GlobalStyles, Page } from './styles';

const Dashboard: React.FC = () => {
  return (
    <>

    <Page>
      {/* div que vai sobrepor os textos */}
      <ModelsWrapper>
      <div className="">
        {[
          'Model 1',
          'Model 2',
          'Model 3',
          'Model 4',
          'Model 5',
          'Model 6',
          'Model 7'
        ].map(textName => (
          <ModelsSection
          key={textName}
          className="colored"
          name= {textName}
          overlayNode={
          <DefaultOverlayContent 
            label={textName}
            description="R$ 4000"
          />
          }
          />
        ))}
    
         
         
        </div>
      </ModelsWrapper>
    </Page>

    <GlobalStyles/>
    

    </>
  );
}

export default Dashboard;
